import React from "react";

function AddGoals() {
  return (
    <div style={{display:"grid",justifyItems:""}}>
      <h3 className="d-flex align-items-center justify-content-center mt-5">
        Enter the start and end date of challenge
      </h3>
      <div className="d-flex align-items-center justify-content-center">
        <label for="birthday">Start Date:</label>
        <input
          style={{ width: "150px", margin: "20px", cursor: "pointer" }}
          type="date"
          className="form-control "
          placeholder="start date"
          // value={feet}
          // onChange={userEnterFeet}
        />
        <label for="birthday">End Date:</label>
        <input
          style={{ width: "150px", margin: "20px", cursor: "pointer" }}
          type="date"
          className="form-control border-orange-600"
          placeholder="end date"
          // value={feet}
          // onChange={userEnterFeet}
        />
      </div>
      <div
        style={{
          width: "500px",
          height: "200px",
          backgroundColor: "white",
          margin: "50px",
        }}
      >
        <div
          style={{ display: "grid", justifyContent: "center", padding: "5px" }}
        >
          <h5>Add Monthy Goal</h5>
          <button>ADD GOAL</button>
        </div>
      </div>
    </div>
  );
}

export default AddGoals;
